INSERT INTO `products` (`pid`, `product_name`, `product_image`, `product_validity`, `product_timing_from`, `product_timing_to`, `product_description`, `product_price`, `capacity1`, `capacity2`, `capacity3`, `capacity4`, `capacity5`, `capacity6`, `capacity7`, `capacity8`, `capacity9`, `capacity10`) VALUES
(1, 'Full Day Mumbai City Private Sightseeing Tour', 'full day.jpg', '2025-01-25', '08:12:00', '20:12:00', 'Explore Mumbai with our \'Full Day City Tour\' covering Hanging Garden, HajiAli Mosque, Gateway Of India, Marine Drive, and more. Our well-maintained, air-conditioned cars and knowledgeable guides ensure a memorable experience. Live life carefree with Linda Tours, discovering historic events, serene bays, and vibrant cultural celebrations in Mumbai. Uncover the city\'s beauty, art, and festivals, capturing unforgettable moments with us. Your journey with Linda Tours guarantees unparalleled travel solutions.', 7250.00, 1.00, 7400.00, 9350.00, 12450.00, 13850.00, 14500.00, 16950.00, 19350.00, 21750.00, 24200.00),
(2, 'Half Day Mumbai City Private Sightseeing Tour', 'halfday.jpg', '2026-10-30', '08:00:00', '21:00:00', '\"Explore Mumbai\'s rich history, coastal beauty, scenic spots, and religious sites with Linda Tours. Our half-day tour ensures complete satisfaction, unfolding historic events, preserving art, and offering experienced guides for a seamless experience. Discover the best of Mumbai with us!\"', 6250.00, 6250.00, 7600.00, 9350.00, 9700.00, 10350.00, 12450.00, 14550.00, 16600.00, 18650.00, 20750.00),
(3, 'Elephanta Caves & Island Guided Private Tour', 'elephanta.jpg', '2025-05-12', '17:53:00', '17:53:00', 'The Elephanta Caves are situated in Western India on Elephanta Island (also called the Island of Gharapuri), which highlights two hillocks isolated by a tight valley. The little island is dabbed with various old archeological remaining parts that are the sole declarations to its rich social past. ', 8650.00, 8650.00, 9950.00, 11650.00, 13850.00, 15550.00, 18650.00, 21750.00, 24900.00, 21000.00, 31150.00),
(4, 'Mumbai By Night: Lights & Luminance', 'caption (2).jpg', '2025-12-16', '18:16:00', '18:17:00', 'Explore the vibrant spirit of Mumbai through our Evening Tour, designed for business travelers and tourists with limited time. This afternoon to evening excursion captures the city\'s essence as it transitions from a bustling day to a more relaxed evening.', 4850.00, 4850.00, 6650.00, 8300.00, 8550.00, 10700.00, 12850.00, 15000.00, 17150.00, 19300.00, 21450.00),
(5, 'Tour of Dharavi Slum', 'c0 (1).jpg', '2025-12-16', '19:01:00', '19:01:00', 'Dharavi is one of the biggest slums in Asia. Dharavi’s monetary result is assessed to be around 1 billion US dollars yearly a lot of that income is created by the reusing industry more than 20 million individuals live in Mumbai they produce north of 6,500 tons of trash each and every day more than 85% of that waste is reused.\r\nDHARAVI it’s one of the most dynamic places for outrageous business on our Planet.', 4300.00, 4300.00, 4302.00, 4303.00, 4304.00, 4305.00, 4306.00, 4307.00, 4308.00, 4309.00, 4310.00),
(6, 'Bollywood Tour', 'img (1).jpg', '2025-12-16', '19:09:00', '19:09:00', 'Every day is a screenplay to your imagination, well-scripted one ventures high in real.\r\nWhen it comes to Bollywood we delve into the different world of imagination. The Bollywood industry in present times too is offering employment to millions and offering the best entertainment to billions. It is a different experience to know the minutest aspects closely. When you sign up for Bollywood tour with us, professional tour guides give you an immense knowledge of coordination, technology, and other aspects. ', 7050.00, 7050.00, 11350.00, 17050.00, 22750.00, 25850.00, 31000.00, 36150.00, 41350.00, 46500.00, 51650.00),
(7, 'Mumbai City sightseeing with Elephanta caves Tour', '365X305 (9).png', '2026-12-17', '19:41:00', '19:41:00', 'Exploring the vibrant heart of India with our Mumbai City Sightseeing and Elephanta Caves Tour. Immerse yourself in the bustling energy of Mumbai\'s iconic landmarks, from the Gateway of India to Marine Drive. Then, venture to the mystical Elephanta Caves, a UNESCO World Heritage site, and uncover ancient rock-cut sculptures and rich cultural history. A perfect blend of modern metropolis and historic treasures awaits you on this captivating journey through Mumbai.', 10400.00, 10400.00, 10400.00, 12472.00, 12472.00, 15550.00, 18700.00, 21800.00, 24950.00, 28050.00, 28050.00),
(8, 'Elephanta caves and island with Dharavi Slum Tour', 'Untitled design (70).png', '2025-12-16', '20:02:00', '20:02:00', 'Embark on a unique Mumbai experience with our Elephanta Caves and Dharavi Slum Tour. Discover the ancient allure of Elephanta Island, home to awe-inspiring caves and sculptures. Then, delve into the heart of Mumbai\'s contrasts with a visit to Dharavi, Asia\'s largest slum, where resilience and community spirit shine amid the challenges. This tour offers a profound exploration of Mumbai\'s diverse landscapes, from cultural heritage to the vibrant tapestry of everyday life.', 10400.00, 10400.00, 10400.00, 12472.00, 12472.00, 15550.00, 18700.00, 21800.00, 24950.00, 28050.00, 28050.00),
(9, 'Private City with Dharavi Slum Sightseeing Tour', 'Untitled design (60).png', '2025-12-17', '20:09:00', '20:09:00', '\r\nEmbark on a personalized journey through the soul of Mumbai with our Private City and Dharavi Slum Sightseeing Tour. Witness the city\'s dynamic contrasts as you explore iconic landmarks and delve into the heart of Dharavi, Asia\'s largest slum. This exclusive tour offers a deep and intimate connection with Mumbai\'s diverse facets, blending cultural discovery with a compassionate understanding of local communities. Experience the city like never before on this private and thought-provoking excursion.', 10400.00, 10400.00, 10400.00, 12472.00, 12472.00, 15550.00, 18700.00, 21800.00, 24950.00, 28050.00, 28050.00),
(10, 'Elephanta Caves & Island Guided Private Tour', '1000061997 (1).jpeg', '2025-12-16', '20:14:00', '20:14:00', 'Embark on an exclusive adventure with our Elephanta Caves & Island Guided Private Tour. Let our knowledgeable guide lead you through the mesmerizing ancient caves, a UNESCO World Heritage site, and unveil the rich history and intricate sculptures. Enjoy the luxury of a private tour, ensuring a personalized experience on this captivating journey to Elephanta Island. Immerse yourself in the beauty and cultural significance of this iconic destination with the comfort and flexibility of a private exploration.', 8650.00, 8650.00, 9950.00, 11650.00, 13850.00, 15550.00, 18650.00, 21750.00, 24900.00, 27500.00, 31150.00),
(11, 'Lonavla Hill Station Tour', 'IMG_20220529_161116 (1).jpg', '2025-12-16', '20:21:00', '20:21:00', 'Escape to the serene beauty of Lonavla with our Hill Station Tour. Nestled in the Western Ghats, Lonavla is a picturesque retreat offering lush green landscapes, cascading waterfalls, and cool mountain air. Explore vantage points like Tiger Point and Rajmachi Fort, indulge in local delicacies, and unwind amidst nature\'s tranquility. Our Lonavla Hill Station Tour promises a rejuvenating getaway from the hustle and bustle, with breathtaking views and a refreshing mountain ambiance. Experience the magic of Lonavla with our guided tour for an unforgettable journey into nature\'s embrace.', 9600.00, 9600.00, 9600.00, 14400.00, 19200.00, 19200.00, 22140.00, 22140.00, 23616.00, 26550.00, 29500.00),
(12, 'Kanheri Caves Sightseen Tour', '365X305 (7).png', '2025-12-16', '20:26:00', '20:26:00', 'Embark on a captivating journey through history with our Kanheri Caves Sightseeing Tour. Nestled in the lush surroundings of Sanjay Gandhi National Park, the Kanheri Caves boast ancient rock-cut architecture and intricate Buddhist sculptures. Our guided tour takes you on a fascinating exploration of these historic caves, providing insights into the rich cultural and religious heritage they hold. Immerse yourself in the serenity of this archaeological wonder and uncover the secrets of Kanheri Caves with our informative and engaging tour.', 9050.00, 9050.00, 9700.00, 12450.00, 13850.00, 15550.00, 15550.00, 15550.00, 15550.00, 15550.00, 15550.00),
(13, 'Karla and Bhaja Caves Tour', 'Untitled design (61).png', '2023-12-12', '20:30:00', '20:30:00', 'Discover the ancient wonders of India with our Karla and Bhaja Caves Tour. Nestled in the hills near Lonavala, these rock-cut caves showcase remarkable Buddhist architecture dating back to the 2nd century BCE. Marvel at the intricately carved sculptures, grand chaityas, and exquisite stupas that narrate tales of India\'s rich cultural history. Our guided tour offers a captivating journey through time, providing insights into the artistry and spirituality of these well-preserved archaeological gems. Immerse yourself in the mystique of Karla and Bhaja Caves for a memorable exploration of India\'s heritage.', 11050.00, 11050.00, 11800.00, 17700.00, 23600.00, 23900.00, 24500.00, 25850.00, 29500.00, 33200.00, 36900.00),
(14, 'Mumbai Shore Excursion Tour', 'Untitled design (64).png', '2023-12-06', '20:34:00', '20:34:00', 'Experience the essence of Mumbai\'s diversity with our Shore Excursion Tour. As your cruise docks, our guided tour seamlessly blends the city\'s iconic landmarks like the Gateway of India and Marine Drive with cultural gems like the Elephanta Caves or vibrant markets. Immerse yourself in the vibrant tapestry of Mumbai\'s history, architecture, and local flavors during this enriching and convenient shore excursion. Discover the best of Mumbai\'s attractions without missing a beat as you explore the city\'s highlights and make the most of your time ashore.', 7250.00, 7250.00, 7400.00, 9350.00, 12450.00, 13850.00, 14500.00, 16950.00, 19350.00, 21750.00, 24200.00),
(15, 'Mumbai Street Food Tour', 'Untitled design (69).png', '2025-12-17', '12:16:00', '12:16:00', 'Indulge your taste buds in the vibrant tapestry of Mumbai with our Street Food Tour. Traverse bustling streets and hidden alleys to savor an array of mouthwatering local delicacies. From spicy pav bhaji to crispy vada pav and sweet chole bhature, our guided tour ensures a delectable journey through the diverse flavors of Mumbai\'s street food scene. Immerse yourself in the culinary delights, aromatic spices, and cultural anecdotes that make this experience a feast for the senses. Join us for an unforgettable gastronomic adventure through the heart of Mumbai\'s street food culture.', 4089.00, 4089.00, 4090.00, 4091.00, 4092.00, 4093.00, 4094.00, 4095.00, 4096.00, 4097.00, 4098.00);

